values:
I HATE THE HEAT. I am over it. It&#39;s draining the life out of meeee!

Working in it sucks. Driving around in my hot car, and going back to the store to do dishes in fucking hot water and pulling pizzas out of a hot oven. Man, I love my job but it&#39;s killing me right now! I get sooo gross at work...it&#39;s quite depressing.&nbsp;

At least I have my honey at the end of these long, terrible days :)
